import logo from './logo.svg';
import './App.css';
import { useLayoutEffect } from 'react';
import { Route, Routes } from 'react-router';
import Welcome from "src/Welcome/Welcome.js";

function App() {

  useLayoutEffect(() => {
    document.body.style.backgroundColor = "#E5E8ED";
  });

  return (
    <Routes>
      <Route 
        path="/welcome"
        element={
          <Welcome />
        }></Route>
    </Routes>
  );
}

export default App;
